import React, { Component } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Home from "../components/Home";

class Main extends Component() {
  constructor() {
    this.state = {};
  }

  render() {
    return (
      <Router>
        <Routes>
          <Route path="/" element={<Home name="Ernesto" />} />
        </Routes>
      </Router>
    );
  }
}

export default Main;
